import React, { useState } from "react";

// Movie data with 25 movies
const movies = [
  {
    name: "The Dark Knight",
    imdbRating: 9.0,
    posterUrl: "https://m.media-amazon.com/images/I/81cHfEZ7-hL._AC_SY679_.jpg",
    trailerUrl: "https://www.youtube.com/embed/EXeTwQWrcwY",
    description: "A superhero film directed by Christopher Nolan.",
    characters: ["Bruce Wayne", "Joker", "Rachel Dawes"]
  },
  {
    name: "Inception",
    imdbRating: 8.8,
    posterUrl: "https://m.media-amazon.com/images/I/51kEFA+PcsL._AC_SY679_.jpg",
    trailerUrl: "https://www.youtube.com/embed/YoHD9XEInc0",
    description: "A mind-bending thriller by Christopher Nolan.",
    characters: ["Dom Cobb", "Robert Fischer", "Mal"]
  },
  {
    name: "Interstellar",
    imdbRating: 8.6,
    posterUrl: "https://m.media-amazon.com/images/I/91I3VXJwHJL._AC_SY679_.jpg",
    trailerUrl: "https://www.youtube.com/embed/zSWdZVtmtYQ",
    description: "A space exploration film directed by Christopher Nolan.",
    characters: ["Cooper", "Brand", "Murph"]
  },
  {
    name: "The Matrix",
    imdbRating: 8.7,
    posterUrl: "https://m.media-amazon.com/images/I/91vX6vf+I-L._AC_SY679_.jpg",
    trailerUrl: "https://www.youtube.com/embed/vKQi3bBA1y8",
    description: "A hacker discovers a dystopian world controlled by machines.",
    characters: ["Neo", "Trinity", "Morpheus"]
  },
  {
    name: "The Shawshank Redemption",
    imdbRating: 9.3,
    posterUrl: "https://m.media-amazon.com/images/I/51NiGlapXlL._AC_SY679_.jpg",
    trailerUrl: "https://www.youtube.com/embed/6hB3S9bIaco",
    description: "Two imprisoned men form a bond over several years.",
    characters: ["Andy Dufresne", "Ellis Boyd Redding"]
  },
  {
    name: "The Godfather",
    imdbRating: 9.2,
    posterUrl: "https://m.media-amazon.com/images/I/51zXB6W9wtL._AC_SY679_.jpg",
    trailerUrl: "https://www.youtube.com/embed/sY1S34973zA",
    description: "The aging patriarch of an organized crime dynasty transfers control of his clandestine empire to his reluctant son.",
    characters: ["Vito Corleone", "Michael Corleone", "Sonny Corleone"]
  },
  {
    name: "Pulp Fiction",
    imdbRating: 8.9,
    posterUrl: "https://m.media-amazon.com/images/I/71FwJ8llH8L._AC_SY679_.jpg",
    trailerUrl: "https://www.youtube.com/embed/s7EdQ4FqbhY",
    description: "The lives of two mob hitmen, a boxer, a gangster's wife, and a pair of diner bandits intertwine.",
    characters: ["Vincent Vega", "Jules Winnfield", "Mia Wallace"]
  },
  {
    name: "Fight Club",
    imdbRating: 8.8,
    posterUrl: "https://m.media-amazon.com/images/I/81nEnLl0YyL._AC_SY679_.jpg",
    trailerUrl: "https://www.youtube.com/embed/qtRKdVHc-cE",
    description: "An insomniac office worker and a soap salesman form an underground fight club.",
    characters: ["Tyler Durden", "Narrator", "Marla Singer"]
  },
  {
    name: "Forrest Gump",
    imdbRating: 8.8,
    posterUrl: "https://m.media-amazon.com/images/I/81kV3Njq+BL._AC_SY679_.jpg",
    trailerUrl: "https://www.youtube.com/embed/bLvqoHBptjg",
    description: "The presidencies of Kennedy and Johnson, the Vietnam War, the Watergate scandal, and other historical events unfold from the perspective of an Alabama man with an IQ of 75.",
    characters: ["Forrest Gump", "Jenny Curran"]
  },
  {
    name: "The Lord of the Rings: The Return of the King",
    imdbRating: 8.9,
    posterUrl: "https://m.media-amazon.com/images/I/91D1tJga56L._AC_SY679_.jpg",
    trailerUrl: "https://www.youtube.com/embed/r5X-hFf6Bwo",
    description: "Gondor's forces mount a siege in the battle for Middle-earth.",
    characters: ["Frodo Baggins", "Samwise Gamgee", "Gollum"]
  },
  // Add more movie data...
];

const Dashboard = () => {
  const [selectedMovie, setSelectedMovie] = useState(null);
  const [hoveredMovie, setHoveredMovie] = useState(null);

  const handleMovieClick = (movie) => {
    setSelectedMovie(movie);
  };

  const closeModal = () => {
    setSelectedMovie(null);
  };

  return (
    <div className="dashboard">
      <h2>Movies Dashboard</h2>
      <div className="movie-list">
        {movies.map((movie, index) => (
          <div
            key={index}
            className="movie-item"
            onClick={() => handleMovieClick(movie)}
            onMouseEnter={() => setHoveredMovie(movie)}
            onMouseLeave={() => setHoveredMovie(null)}
          >
            <img src={movie.posterUrl} alt={movie.name} />
            <h3>{movie.name}</h3>
            <div className="rating">
              {hoveredMovie?.name === movie.name && (
                <span>IMDb Rating: {movie.imdbRating}</span>
              )}
            </div>
          </div>
        ))}
      </div>

      {selectedMovie && (
        <div className="movie-modal">
          <div className="modal-content">
            <button onClick={closeModal} className="close-btn">Close</button>
            <h2>{selectedMovie.name}</h2>
            <iframe
              src={selectedMovie.trailerUrl}
              title="Movie Trailer"
              width="100%"
              height="400px"
              allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
              allowFullScreen
            />
            <p><strong>Description:</strong> {selectedMovie.description}</p>
            <p><strong>Cast:</strong> {selectedMovie.characters.join(", ")}</p>
          </div>
        </div>
      )}
    </div>
  );
};

export default Dashboard;
